import React, { useState } from "react";
import {
  Box,
  Grid,
  Text,
  Flex,
  Accordion,
  Center,
  Avatar,
  Badge,
  Checkbox,
  Button,
  ColorPicker,
  Input,
  Stack,
  Image,
  Card,
  Slider,
  ActionIcon,
} from "@mantine/core";

import {
  IconPlus,
  IconX,
  IconColumns1,
  IconBold,
  IconUnderline,
  IconItalic,
  IconLetterN,
} from "@tabler/icons-react";
import { Dropzone, IMAGE_MIME_TYPE } from "@mantine/dropzone";

const Customize = () => {
  {
    /* Dropzone */
  }

  const [files, setFiles] = useState([]);

  const previews = files.map((file, index) => {
    const imageUrl = URL.createObjectURL(file);
    return (
      <Image
        key={index}
        src={imageUrl}
        onLoad={() => URL.revokeObjectURL(imageUrl)}
      />
    );
  });
  return (
    <Box m="xs" h={`fit-content`} bg="gray.2" style={{ borderRadius: "10px" }}>
      <Box
        bg="indigo.5"
        ml="xs"
        mr="xs"
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          backgroundColor: "indigo.5",
          padding: "10px",
          borderRadius: "10px",
        }}
      >
        <Text
          fw={900}
          c={`#FFFFFF`}
          style={{
            flex: "1",
            textAlign: "center",
          }}
        >
          Customize
        </Text>
        <IconX
          size={28}
          style={{
            borderRadius: "50%",
            background: "red",
            color: "white",
            alignSelf: "flex-end",
          }}
        />
      </Box>

      {/* Category Item */}
      <Accordion
        m="xs"
        variant="contained"
        defaultValue="category-item"
        pb={10}
      >
        <Accordion.Item value="category-item">
          <Accordion.Control bg="#FFFFFF">
            <Text>Category Item</Text>
          </Accordion.Control>
          <Accordion.Panel bg="#FFFFFF">
            <Accordion m="xs" variant="contained">
              
              
              {/* Add More */}
              <Accordion.Item mt="xs" value="addmore">
                <Accordion.Control bg="gray.2" direction="row">
                  <Flex
                    justify="flex-start"
                    align="center"
                    direction="row"
                    gap="md"
                  >
                    <Text c={`indigo.6`}>+ Add More</Text>
                  </Flex>
                </Accordion.Control>
                <Accordion.Panel>
                  <Dropzone
                    accept={IMAGE_MIME_TYPE}
                    onDrop={setFiles}
                    bg="white"
                    h="10rem"
                    style={{
                      position: "relative",
                      border: "1px solid #1b1c1b",
                      borderRadius: "5px",
                    }}
                  >
                    {previews}
                    <Text
                      style={{
                        position: "absolute",
                        top: "50%",
                        left: "50%",
                        transform: "translate(-50%, -50%)",
                      }}
                    >
                      Drop images here
                    </Text>
                  </Dropzone>
                  <Flex direction="column">
                    <Text mt="xs">Background Color</Text>
                    <ColorPicker mt="xs" w="auto" size="lg" format="rgba" />
                  </Flex>
                  <Flex direction="column">
                    <Text mt="xs">Level</Text>
                    <Input placeholder="Input component" />
                  </Flex>
                </Accordion.Panel>
              </Accordion.Item>
            </Accordion>
          </Accordion.Panel>
        </Accordion.Item>
      </Accordion>
    </Box>
  );
};

export default Customize;
